import React from "react";
import styles from "../styles/Main.module.css";
import {
  repair_electrical,
  replacing_interior,
  additional_equipment,
  auto_light,
} from "./helper";

const Electric = () => {
  return (
    <section className={styles.engine__block}>
      <div className={styles.engine__content}>
        <div className={styles.electric__banner}>
          <h1 className={styles.engine__banner_title}>
            Ремонт и техническое обслуживание двигателей
          </h1>
        </div>
        <div className={styles.engine__info}>
          <p className={styles.engine__text}></p>
          <h2 className={styles.engine__title}></h2>
        </div>
      </div>
    </section>
  );
};

export default Electric;
